"use strict";(self.webpackChunkrctblg=self.webpackChunkrctblg||[]).push([[409],{409:(s,t,n)=>{n.r(t),n.d(t,{default:()=>l});n(43);var c=n(579);const l=()=>(0,c.jsxs)("dl",{children:[(0,c.jsx)("dt",{className:"daybutton",children:"day26 \uac1c\uc778 \ube14\ub85d\uccb4\uc778 \ub124\ud2b8\uc6cc\ud06c \uc870\uc0ac \ube14\ub85c\uae45"}),(0,c.jsx)("dd",{className:"daycontent",children:(0,c.jsx)("p",{children:"\ube14\ub85c\uc11c\ub9ac: \ub18d\uc5c5\uc0b0\uc5c5 \uad00\ub828\ub41c \uc554\ud638\ud654\ud3d0 \ubd80\ubb38\uc774\uba70, \uc774 \uc0ac\uc774\ud2b8 \uae30\uc900\uc73c\ub85c\uc5ec\ub7ec \ubd84\uc57c\ub4e4\uc911\uc5d0\uc11c \ub18d\uc5c5 \ubd84\uc57c\uc5d0\uc11c \uc720\uc77c\ud558\uac8c \uc874\uc7ac\ud558\uc5ec \ud638\uae30\uc2ec \ud604\ud669\uc758 \ubb38\uc81c\uc810, \uc5d0 \ub530\ub978 \ube14\ub85c\uc11c\ub9ac \uc11c\ube44\uc2a4 \uc545\uc758\uc801\uc73c\ub85c \ub2e8\uae30 \uc801\uc778 \ud22c\uc790\uac00 \ubaa9\uc801\uc778 \ub124\ud2b8\uc6cc\ud06c\ub97c \uc81c\uc678\ud558\uace0 \uc7a5\uae30\uc801\uc73c\ub85c \uc720\uc9c0\ub418\ub294\ub370 \uba54\uc778\ub137\uc758 \ud1a0\ud070\uac00\uaca9\uc774 \uc9c0\uc18d\uc801\uc73c\ub85c \ud558\ub77d\ud558\uace0 \uc720\uc9c0\ub418\ub294 \ube14\ub85d\uccb4\uc778\uc774 \uad81\uae08\ud558\uc5ec \uc54c\uc544\ubd24\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \ube14\ub85d\uccb4\uc778\ub4e4\uc744 \ud3ec\ud568\ud55c \ubaa8\ub4e0 \ube14\ub85d\uccb4\uc778\ub4e4\uc774 \uc124\uacc4\uc640 \uad6c\uc0c1 \ub530\ub978 \ub9ce\uc740 \uc2dc\uac04\uc744 \ud22c\uc790\ud574\uc11c \uc0c1\uc7a5\uc73c\ub85c \uc62c\ub77c\uc628\uac83\uc740 \uac19\uc744 \uac83\uc774\uc9c0\ub9cc \uadf8\ub4e4\uc774 \uace0\ub824\ud558\uc9c0 \ubabb\ud55c\ubd80\ubd84\uc774\ub098 \ub193\uce5c\ubd80\ubd84\uc774 \ubb34\uc5c7\uc9c0 \uc54c\uc544\ubd24\uc2b5\ub2c8\ub2e4 \ubc31\uc11c\uc758 \ub0b4\uc6a9\uc744 \ubc14\ud0d5\uc73c\ub85c 6p \ud604\ud669\ubb38\uc81c\uc810: \uc138\uacc4\uc801\uc73c\ub85c \uc0dd\uc0b0,\ubcf4\uad00,\ud3ec\uc7a5,\ub3c4\uc18c\ub9e4,\uc720\ud1b5 \ub4f1 \uc0dd\uc0b0\uc790\uc5d0\uc11c \uc18c\ube44\uc790\uae4c\uc9c0 \uc804\ub2ec\ub418\ub294 \uacfc\uc815\uc5d0\uc11c \uc804\uc138\uacc4 \uc2dd\ud488 1/3 \ub0ad\ube44\ub418\uace0 \uc788\ub2e4 \uc57d 16\uc5b5T, 15000\uc870\u20a9 \ubb38\uc81c\ub97c \ubc14\ub85c\uc7a1\uace0\uc790 \uc2e0\uae30\uc220 \ubc18\uc601, \ub370\uc774\ud130\ub97c \ud65c\uc6a9\ud574 \uacf5\uae09\ub9dd\uc744 \ud6a8\uc728\ud654 \ud588\uc9c0\ub9cc \uc218\uc694\uc640 \uacf5\uae09\uc608\uce21 \ucc98\ub7fc \uc815\ud655\ud55c \uacf5\uae09\ub9dd \uc744 \ud30c\uc545\ud558\uc9c0 \ubabb\ud558\uace0 \uc788\ub2e4. \uacf5\uae09\ub9dd \uae30\uc220\uc801\uc6a9\uc740 140\uc870\uc6d0\uc758 \ube44\uc6a9\uc744 \uc808\uc57d\ud558\uba70, \ucc38\uc5ec\uc790\uac04 \ud611\uc5c5\ub9cc\uc73c\ub85c\ub3c4 \uc57d 60\uc870\uc6d0\uc758 \uc2dd\ud488\uc774 \ud3d0\uae30\ub418\ub294 \uac83\uc744 \ub9c9\uc744\uc218 \uc788\ub2e4 \ucd9c\ucc98:BCG boston consulting group \uc774 \ubc16\uc5d0\ub3c4 \uc628\ub77c\uc778 \ub18d\uc2dd\ud488 \uc2dc\uc7a5\uc758 \uc131\uc7a5\uc744 \uc900\ube44\uc640 \uac1c\uc120, \uc911\uac04\ub2e8\uacc4 \uc720\ud1b5\ub9c8\uc9c4 [1]\ube14\ub85c\uc11c\ub9ac \uc194\ub8e8\uc158:1.\ud22c\uba85\ud558\uace0 \uc2e0\ub8b0\ub3c4 \ub192\uc740 \uacf5\uae09\ub9dd \uad6c\ucd95: \ube14\ub85d\uccb4\uc778 \uae30\ubc18\uc73c\ub85c \uc0dd\uc0b0, \uc720\ud1b5, \uc18c\ube44 \ub370\uc774\ud130\ub97c \ubd84\uc0b0 \uc6d0\uc7a5\uc5d0 \uc800\uc7a5\ud558\uc5ec \ucc38\uc5ec\uc790 \uac04 \ud22c\uba85\ud55c \uac70\ub798\uc640 \uc548\uc804\ud55c \uba39\uac70\ub9ac \ubc0f \uacf5\uc815 \uac70\ub798\ub97c \ubcf4\uc7a5\ud569\ub2c8\ub2e4. 2.\ud488\uc9c8 \uad00\ub9ac \uc2dc\uc2a4\ud15c: IoT\uc640 \ube14\ub85d\uccb4\uc778\uc744 \uacb0\ud569\ud558\uc5ec \uc704\xb7\ubcc0\uc870\uac00 \ubd88\uac00\ub2a5\ud55c \ud488\uc9c8\uad00\ub9ac \uc2dc\uc2a4\ud15c\uc744 \uad6c\ucd95\ud558\uace0, \uc2e4\uc2dc\uac04\uc73c\ub85c \ub370\uc774\ud130 \uc785\ub825, \ucd94\uc801, \uc99d\uba85\ud560 \uc218 \uc788\ub294 \ubaa8\ub4c8\uc744 \uc81c\uacf5\ud569\ub2c8\ub2e4. 3.\uacf5\uae09\ub9dd \ud6a8\uc728\ud654: \ub370\uc774\ud130 \uae30\ubc18\uc73c\ub85c \uc2e4\uc2dc\uac04 \uacf5\uae09\uacfc \uc218\uc694 \uc608\uce21\uc744 \uac00\ub2a5\ud558\uac8c \ud558\uace0, \uc2dc\uc2a4\ud15c \uc790\ub3d9\ud654\ub97c \ud1b5\ud574 \ud655\uc7a5 \uac00\ub2a5\ud55c \uae30\ud68c\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4. \uc774\ub85c \uc778\ud574 \uc0dd\uc0b0, \uacf5\uae09, \uc720\ud1b5, \uc18c\ube44 \uacfc\uc815\uc5d0\uc11c \ubc1c\uc0dd\ud558\ub294 \ube44\uc6a9\uc744 \ucd5c\uc18c\ud654\ud569\ub2c8\ub2e4. \ub9c8\ucf13\ube14\ub9ac & \ub098\uc774\uc2a4\ud478\ub4dc \uc11c\ube44\uc2a4: \ud0c8\uc911\uc559\ud654\ub41c \uc9c1\uac70\ub798: \uc0dd\uc0b0\uc790\uc640 \uc18c\ube44\uc790\uac00 \uc9c1\uc811 \uac70\ub798\ud560 \uc218 \uc788\ub294 \ube14\ub85d\uccb4\uc778 \uae30\ubc18\uc758 \uc9c1\uac70\ub798 \ud50c\ub7ab\ud3fc\uc73c\ub85c, \uc911\uc559\ud654\ub41c \uc720\ud1b5 \uad6c\uc870\uc5d0\uc11c \ubc97\uc5b4\ub0a9\ub2c8\ub2e4. \uc2a4\ub9c8\ud2b8 \uacc4\uc57d\uc744 \ud1b5\ud574 \uc18c\ube44\uc790\uc640 \ub3c4\uc18c\ub9e4\uc5c5\uc790\uac00 \ub18d\uc2dd\ud488\uc744 \uc608\uc57d \uad6c\ub9e4\ud558\uace0, \uc0dd\uc0b0\uc790\ub294 \ud310\ub9e4\uc640 \uc7ac\uace0 \uad00\ub9ac, \uacc4\uc57d \ubd88\uc774\ud589 \ub9ac\uc2a4\ud06c\ub97c \uc904\uc77c \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc18c\ube44\uc790\ub294 \uacf5\uae09 \uacfc\uc815\uc744 \ub354 \uc2e0\ub8b0\ud560 \uc218 \uc788\uc73c\uba70, \uc800\ub834\ud55c \uac00\uaca9\uc5d0 \ub18d\uc2dd\ud488\uc744 \uad6c\ub9e4\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. [2]\ube14\ub85c\uc11c\ub9ac \uae30\uc22035p:\uc9c1\uc5c5\ud2b9\uc131\uc0c1 it\uc815\ubcf4\ub97c \uc811\ud558\uae30 \ud798\ub4e0 \ub18d\uc0b0\uc5c5\uc885\uc0ac\uc790\ub4e4\uc744 \uc704\ud574 \uc0ac\uc6a9\uc790 \ud3b8\uc758\uc131 \ud5a5\uc0c1\uc744 \ucd5c\uc6b0\uc120 \uc0dd\uac01\ud558\uace0 \uac1c\ubc1c \uc2dc\uc2a4\ud15c\uc758 \uad6c\uc870\ub294 \uc751\uc6a9\uc11c\ube44\uc2a4 \ub808\uc774\uc5b4:\uc0ac\uc6a9\uc790\uac00 \uc9c1\uc811 \uc774\uc6a9\ud558\ub294 \ub2e8\uacc4 \ucef4\ud3ec\ub10c\ud2b8 \uc11c\ube44\uc2a4 \ub808\uc774\uc5b4:\uc0ac\uc6a9\uc790\uc640 \ube14\ub85d\uccb4\uc778\uc758 \uc5f0\uacb0 \ubc0f \ubd84\uc11d\uc5d4\uc9c4 \ub2e8\uacc4 \ud0c8\uc911\uc559\ud654 \ub808\uc774\uc5b4:\ube14\ub85d\uccb4\uc778\uacfc \uc0ac\uc774\ub4dc\uccb4\uc778\uc744 \uc774\uc6a9\ud574 \uc2a4\ub9c8\ud2b8\ucee8\ud2b8\ub799\ud2b8\uac00 \uc9c1\uc811 \uc2e4\ud574\ub418\ub294 \ub2e8\uacc4 \ube14\ub85c\uc11c\ub9ac \ud50c\ub7ab\ud3fc\uc740 \ud558\uc774\ud37c\ub808\uc800 \ud328\ube0c\ub9ad\uc744 \uae30\ubc18\uc73c\ub85c \ud55c 3\ub2e8\uacc4 \uc2dc\uc2a4\ud15c \uad6c\uc870\ub97c \ud1b5\ud574 \uc720\uae30\uc801\uc73c\ub85c \uc791\ub3d9\ud569\ub2c8\ub2e4. \uac01 \ub808\uc774\uc5b4\ub294 \uc0ac\uc6a9\uc790 \uc0c1\ud638\uc791\uc6a9, \ube14\ub85d\uccb4\uc778\uacfc\uc758 \uc5f0\uacb0, \uc2a4\ub9c8\ud2b8 \uacc4\uc57d \uc2e4\ud589\uc744 \ub2f4\ub2f9\ud558\uba70, \ud50c\ub7ab\ud3fc \ub0b4\uc5d0\uc11c \uc774\ub8e8\uc5b4\uc9c0\ub294 \ubaa8\ub4e0 \uac70\ub798\uc640 \uacc4\uc57d\uc740 \ud0c8\uc911\uc559\ud654\ub41c \ubc29\uc2dd\uc73c\ub85c \ucc98\ub9ac\ub429\ub2c8\ub2e4. \ube14\ub85c\uc11c\ub9ac \ud50c\ub7ab\ud3fc\uc740 \ud558\uc774\ud37c\ub808\uc800 \ud328\ube0c\ub9ad\uc744 \uae30\ubc18\uc73c\ub85c \ud55c 3\ub2e8\uacc4 \uc2dc\uc2a4\ud15c \uad6c\uc870\ub97c \ud1b5\ud574 \uc720\uae30\uc801\uc73c\ub85c \uc791\ub3d9\ud569\ub2c8\ub2e4. \uac01 \ub808\uc774\uc5b4\ub294 \uc0ac\uc6a9\uc790 \uc0c1\ud638\uc791\uc6a9, \ube14\ub85d\uccb4\uc778\uacfc\uc758 \uc5f0\uacb0, \uc2a4\ub9c8\ud2b8 \uacc4\uc57d \uc2e4\ud589\uc744 \ub2f4\ub2f9\ud558\uba70, \ud50c\ub7ab\ud3fc \ub0b4\uc5d0\uc11c \uc774\ub8e8\uc5b4\uc9c0\ub294 \ubaa8\ub4e0 \uac70\ub798\uc640 \uacc4\uc57d\uc740 \ud0c8\uc911\uc559\ud654\ub41c \ubc29\uc2dd\uc73c\ub85c \ucc98\ub9ac\ub429\ub2c8\ub2e4. \ubc31\uc11c 28p \ube14\ub85c\uc11c\ub9ac \uc5d0\uc11c \uc0ac\uc6a9\ub418\ub294 \ud1a0\ud070 bly\ub294 \ub18d\uc2dd\ud488 \uacf5\uae09\ub9dd \ud50c\ub7ab\ud3fc \ub0b4 \uc774\ub904\uc9c0\ub294 \uacbd\uc81c\ud65c\ub3d9\uc744 \uac15\ud654\uc2dc\ud0a4\uace0 \ucc38\uc5ec\uc790 \ub4e4\uc5d0\uac8c \ub3d9\uae30\ubd80\uc5ec\ud558\ub294 \uc720\ud2f8\ub9ac\ud2f0 \ud1a0\ud070\uc785\ub2c8\ub2e4 \ud604\uc7ac 10\uc5b5\uac1c\uc758 \ud1a0\ud070\uc774 \ubc1c\ud589\ub418\uc5c8\uace0 \ucd94\uac00\ubc1c\ud589\uc740 \ubd88\uac00\ub2a5 \ud558\uba70 \uc0dd\ud0dc\uacc4 \uc720\uc9c0\ub97c\uc704\ud574 \ucd94\ud6c4 \uc18c\uac01 \uac00\ub2a5\uc131\ub3c4 \uc788\uc2b5\ub2c8\ub2e4 \uc8fc\uc694 \uc6a9\ub3c4\ub294 \uc0dd\ud0dc\uacc4 \ub0b4 \ubaa8\ub4e0 \uacc4\uc57d,\uac70\ub798\uc5d0 \uc0ac\uc6a9\uc774 \ub429\ub2c8\ub2e4 \ud22c\uba85\ud558\uace0 \uc2e0\ub8b0\ud560 \uc218 \uc788\ub294 \ub18d\uc2dd\ud488 \uc0dd\ud0dc\uacc4\uac00 \ud65c\uc131\ud654\ub418\uc5b4 \uc774\ub825 \uad00\ub9ac \ubc0f \uc608\uc57d \uad6c\ub9e4 \uae30\uac04\uc774 \uae38\uc5b4\uc9c0\uace0 \uacc4\uc57d\uc758 \uc591\uc774 \uc99d\uac00\ud568\uc5d0 \ub530\ub77c Staking \ub418\ub294 BLY \uc758 \uaddc\ubaa8\uac00 \uc99d\uac00\ud558\uba70, \ud50c\ub7ab\ud3fc \uc131\uc7a5\uc5d0 \ube44\ub840\ud558\uc5ec BLY \ud1a0\ud070\uc758 \uac00\uce58 \ub610\ud55c \uc99d\uac00\ud558\uac8c \ub429\ub2c8\ub2e4. \uc774\uc678\uc5d0\ub3c4 \uc0dd\uc0b0\uc790, \ud310\ub9e4\uc790 \ubc0f \uc18c\ube44\uc790\ub294 Staking\uac00\ub2a5 \ud1a0\ud070\uc774 \ub0ae\uc740 \uc774\uc720:\ub18d\uc0b0\uc5c5\uc801\uc6a9\ud55c \ube14\ub85d\uccb4\uc778\uc740 \ud2b9\uc131\uc0c1 \uae30\uc874\uc2dc\uc2a4\ud15c\uc5d0 \uc7a5\ubcbd\uc744 \ub290\uaef4 \ub514\uc9c0\ud138 \uc804\ud658\uc774 \ub290\ub9b0\ubd84\uc57c \uc774\ub2e4 \ubcf4\ub2c8 \uc2dc\uc7a5\uc758 \uc2e0\ub8b0\uac00 \ubd80\uc871\ud55c\uac83\uc73c\ub85c \ubcf4\uc785\ub2c8\ub2e4."})})]})}}]);
